import { Card } from 'react-bootstrap';
import MyStyle from '../styles/colorStyle';

const Footer = () => (
    <dev>
        <Card style={MyStyle.col_background}>
            <Card.Body>
                <p className="text-center">
                    Copyright@ 2020
                    <span> Muhalik </span>
                    - Online Shopping Website
            </p>
            </Card.Body>
        </Card>
        <style jsx>{`
            dev {
                position: absolute;
                left: 0;
                bottom: 0; 
                right: 0;
            }
            p {
                font-size: smaller;
            }
            span {
                font-size: medium;
                font-weight: bold;
            }
        `}</style>
    </dev>
)

export default Footer;
